import React from "react";

let id=1;

const Recipe= (allRecipes)=>{
    const {id,name,image} = allRecipes;
    return (
        <div>
            {
            <ul key={id}>
                <p>{name}</p>
                <p>{image}</p>
            </ul>
            }
        </div>
    )
}

export default Recipe;
